import React, {memo} from 'react';
import styled from 'styled-components';

const HeaderContainer = styled.div`
    background-color: #ff05;

    .navInner{
      display: flex;
      width:100%;
      background-color: #f605;
    }
`;

const Header = memo(() => {
  return (
    <HeaderContainer>
      <div className='navInner'>
        <ul className='topMenu'>
          <li><a href='#'>더본코리아</a></li>
          <li><a href='#'><img src='' alt='facebook-logo' /></a></li>
          <li><a href='#'><img src='' alt='instargram-logo' /></a></li>
        </ul>
        <div className='navWrap'>
          <img src='/img/logo.png' alt='logoImg' />
          <ul>
            <li><a href='#'>빽다방</a></li>
            <li><a href='#'>메뉴</a></li>
            <li><a href='#'>소식</a></li>
            <li><a href='#'>커뮤니티</a></li>
            <li><a href='#'>매장안내</a></li>
            <li><a href='#'>창업안내</a></li>
            <li><a href='#'>고객의 소리</a></li>
          </ul>
        </div>
      </div>
    </HeaderContainer>
  );
});

export default Header;
